import React from "react";

export const TileList = () => {
  return (
    <div>
      <table>
        <thead>
          <tr>
            <th>#</th>
            <th>Name</th>
            <th>Phone</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>1</td>
            <td>John Doe</td>
            <td>123-456-7890</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
};
